import React from 'react';

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img src={require("../assets/header-img.png")} alt="numberGame" width="100%"/>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
